            <div class="row">
                <div class="col-lg-12">
                    <div class="blockquote blockquote-color text-dark" style="background-color: #ECF9FD;">
                        <h5 class="text-uppercase"><strong>Booking Information</strong></h5>
                        <p>Once a booking for a room is processed online, the student has 3 days to accept the offer. It
                            means for the student (and the guarantor if required by the accommodation provider/landlord)
                            to;&nbsp;</p>
                        <p>· Accept and execute the tenancy contract and,&nbsp;</p>
                        <p>· Pay an advance rent payment (if required by the accommodation provider/landlord).</p>
                        <p>Once these steps are done, the booking is completed. &nbsp;If not completed within these 3
                            days (i.e. not accepted and executed the tenancy contract and/or not paid any advance rent
                            payment if required), the offer will expire and the room will be made available for someone
                            else to book. &nbsp;If the student still wants a room, we can re-process a booking, but we
                            cannot guarantee that the same room or the same price will be available.</p></div>
